import React, { useState } from "react";

function List(props) {
	const [clicked, setClicked] = useState(false);

	function handleClick() {
		setClicked((prevValue) => {
			return !prevValue;
		});
	}
	return (
		<div onClick={handleClick}>
			<li style={{ textDecoration: clicked ? "line-through" : "none" }}>
				{props.item}
			</li>
		</div>
	);
}

export default List;
